import React from 'react'

export const TypeScript = ({typeArray})=>{
    let a = typeArray
    if(typeArray.length >1){
        return(
            <div>
                <p>{{a:[0]}}</p>
            </div>
        )
    }else return(
        <div>
            <p>{{a:[0]}}/{{a:[1]}}</p>
        </div>)
}
